(function() {

    let thumbnail_bg_url = 'https://i.pinimg.com/originals/9c/b8/61/9cb86125eeb8ece3634336c58b6fa2b0.jpg';
    thumbnail_bg_url = 'url("' + thumbnail_bg_url + '"';
    console.log(thumbnail_bg_url);

    function nininit() {
        if(document.getElementById("auction_image_parent")) {
        document.getElementById("auction_image_parent").style.backgroundImage = "url('data:image/jpeg;base64,')";
        }
    };

    function updateThumbnailBGs() {
        let thumbnails = document.querySelectorAll(".slave_thumbnail");
//        console.log(thumbnails);
        if(thumbnails) {
            for(var i = 0; i < thumbnails.length; i++) {
                thumbnails[i].style.backgroundImage = thumbnail_bg_url;
                thumbnails[i].style.backgroundSize = 'cover';
                thumbnails[i].style.backgroundPosition = 'center center';
            };
        }
    };

    $( document ).ready(function() {
        nininit();
        window.setInterval(function(){
            updateThumbnailBGs();
        }, 1000);
    });

})();